import React, { Component } from "react";
import NavBar from "./components/NavBar";
import TopNav from "./components/TopNav";
import BottomNav from "./components/BottomNav";
import "./App.css";

class App extends Component {
  state = {};
  render() {
    return (
      <div>
        <TopNavIntro></TopNavIntro>
        <TopNav></TopNav>
        <NavBar></NavBar>
        <BottomNav></BottomNav>
      </div>
    );
  }
}

export default App;
